import { useState } from "react";
import { HeaderContainer,HeaderSubContainer, PrimaryButton, SearchBar, svgIconStyle } from "./Utility";
import { useLocation, useNavigate } from "react-router-dom";
import { BodyContainer, TaskGroup, TaskItem, EditPopup } from "./Utility";
import TaskColumn from "./TaskColumn";

function GlobalContainer() {
    const [query, setQuery] = useState("");
    const location = useLocation();
    const queryParams = new URLSearchParams(location.search);
    const layout = queryParams.get('layout');

    const navigate = useNavigate();

    const search = () => {
        navigate(`/?layout=search&&query=${query}`);
    }
    const clr = () => {
        setQuery("");
        navigate("/");
    }
    return (
    <div style={{position:"relative"}}>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer style={{gap:"8px", width:"600px"}}>
            <SearchBar placeholder="Search here..." type="text"
        value={query}
        onChange={(e) => setQuery(e.target.value)}/> 
            <PrimaryButton onClick={clr}>Clear</PrimaryButton>
            <PrimaryButton onClick={search}>Search</PrimaryButton>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryButton onClick={()=>navigate("/?layout=account")}>Account</PrimaryButton>
            <PrimaryButton onClick={()=>navigate("/?layout=notification")}><svg style={{...svgIconStyle, height : "20px", width : "20px"}} xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24"><path d="M10 21H14C14 22.1 13.1 23 12 23S10 22.1 10 21M21 19V20H3V19L5 17V11C5 7.9 7 5.2 10 4.3V4C10 2.9 10.9 2 12 2S14 2.9 14 4V4.3C17 5.2 19 7.9 19 11V17L21 19M17 11C17 8.2 14.8 6 12 6S7 8.2 7 11V18H17V11Z" /></svg></PrimaryButton>
        </HeaderSubContainer>
    </HeaderContainer>
    <div style={{ display: "flex", flexDirection: "row", height: "100vh",width : "100%" }}>
        <Sidebar />     
        <BodyContainer>
            <TaskColumn />
            <TaskGroup style={{flex: '0 0 35%'}}>

            <h2>Your Stats</h2>
            <TaskItem>
                <p style={{color:"#276cab", fontSize:"60px", fontWeight:"800", margin:"8px"}}>95%</p>
                <p style={{color:"black", fontSize:"20px", fontWeight:"400",alignSelf :"center"}}>Task completion rate</p>
            </TaskItem>
            <TaskItem>
                <p style={{color:"#008b10", fontSize:"60px", fontWeight:"800", margin:"8px"}}>15%</p>
                <p style={{color:"black", fontSize:"20px", fontWeight:"400",alignSelf :"center"}}>More productive this week</p>
            </TaskItem>

            <TaskItem style={{flexDirection:"column"}} >
                <h3>Most productive time of a day</h3>
                <p style={{color:"#276cab", fontSize:"56px", fontWeight:"800", margin:"8px"}}>Morning</p>
            </TaskItem>
            <TaskItem style={{flexDirection:"column"}} >
                <h3>Most productive day of the week</h3>
                <p style={{color:"#276cab", fontSize:"56px", fontWeight:"800", margin:"8px"}}>Monday</p>
            </TaskItem>
            <TaskItem style={{flexDirection:"column"}} >
                <h3>Most productive task type</h3>
                <p style={{color:"#276cab", fontSize:"56px", fontWeight:"800", margin:"8px"}}>Household</p>
            </TaskItem>
            </TaskGroup>
            {/* {editPopupState==0 && <TaskEdit close={setEditPopupOpenState}  taskId={taskId} setTaskId={setTaskId} />}
            {editPopupState==1 && <Account close={setEditPopupOpenState} setAuth={setAuth} setForgotPass={setForgotPass}/>}
            {editPopupState==2 && <Notification close={setEditPopupOpenState} selectedOption={notify} setSelectedOption={setNotify}/>} */}
        </BodyContainer>
    </div>
    </div>
  );
}

export default GlobalContainer;
